import styled from "styled-components";

export const Wrapper = styled.div `
	{
		margin: 20px auto;
		font-size: 25px;
		width: 100%;
		height: 2em;
		position: absolute;
        top: 0;
        left: 0;
        text-align: center;
	}
`;
